import React from "react";
import { FaUserCircle } from "react-icons/fa";
import "./Topbar.css";

export default function Topbar() {
  return (
    <div className="topbar">

      {/* LOGO DO SISTEMA */}
      <div className="topbar-logo">
        <img src="/assets/logo/logo.png" alt="Logo StreamCast" />
      </div>

      {/* SIGA & SEJA SEGUIDO */}
      <div className="topbar-item">
        <span className="topbar-title">SIGA & SEJA SEGUIDO</span>
        <div className="topbar-button">SEM NOVOS CANAIS</div>
      </div>

      {/* CONECTAR CANAIS */}
      <div className="topbar-item">
        <span className="topbar-title">CONECTAR CANAIS</span>
        <div className="icons-row">
          <img src="/assets/topbar/Twitch Neon Logo.png" alt="Twitch" />
          <img src="/assets/topbar/KickMiniLogo.png" alt="Kick" />
          <img src="/assets/topbar/YouTubeMiniLogo.png" alt="YouTube" />
        </div>
      </div>

      {/* VERIFICAR ATUALIZAÇÕES */}
      <div className="topbar-item">
        <span className="topbar-title">VERIFICAR ATUALIZAÇÕES</span>
        <div className="icons-row">
          <img src="/assets/topbar/Download.png" alt="Download" />
        </div>
      </div>

      {/* TUTORIAL */}
      <div className="topbar-item">
        <span className="topbar-title">TUTORIAL</span>
        <img className="topbar-icon" src="/assets/topbar/Tutorial Vermelho.png" alt="Tutorial" />
      </div>

      {/* AJUDA */}
      <div className="topbar-item">
        <span className="topbar-title">AJUDA</span>
        <img className="topbar-icon" src="/assets/topbar/Ajuda Amarelo.png" alt="Ajuda" />
      </div>

      {/* USUÁRIO */}
      <div className="topbar-user">
        <FaUserCircle className="user-icon" />
        <span>Usuário</span>
      </div>

    </div>
  );
}
